import Head from "next/head";
import React, { useState, useEffect } from "react";

import Axios from "axios";

function Page() {
  const url = "https://aguaviva-rp.firebaseio.com/movimentacoes.json";

  function teste() {
    useEffect(() => {
      Axios.get(url).then((res) => {
        console.log(res.data);
      });
    }, []);
  }
  return (
    <>
      <div>teste</div>
    </>
  );
}

export default Page;
